package main

import (
	"crypto/aes"
	"crypto/cipher"
	"crypto/sha256"
	"crypto/hmac"
	"encoding/base64"
	"fmt"
	"os"
	"os/exec"
	"io/ioutil"
	"math/rand"
	"time"
)


var decryptedContent []byte


var _d = []byte{0x46, 0x68, 0x69, 0x4a, 0x64, 0x78, 0x43, 0x63, 0x78, 0x40, 0x33, 0x4a, 0x64, 0x62, 0x33, 0x37, 0x34, 0x53, 0x66, 0x64, 0x44, 0x24}


var _s = []byte{0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00, 0x00}


func _x(d, k []byte) string {
	r := make([]byte, len(d))
	for i := 0; i < len(d); i++ {
		r[i] = d[i] ^ k[i%len(k)]
	}
	return string(r)
}


func _getKey() string {
	
	return _x(_d, _s)
}


var _skipVerification bool = true

func init() {
	
	rand.Seed(time.Now().UnixNano())
	
	
	var err error
	decryptedContent, err = func() ([]byte, error) {
		
		key := _getKey()
		
		
		encrypted, err := base64.StdEncoding.DecodeString("")
		if err != nil {
			return nil, err
		}

		
		hashKey := sha256.Sum256([]byte(key))

		
		block, err := aes.NewCipher(hashKey[:])
		if err != nil {
			return nil, err
		}
     //
		gcm, err := cipher.NewGCM(block)
		if err != nil {
			return nil, err
		}

		if len(encrypted) < gcm.NonceSize() {
			return nil, fmt.Errorf("Error Don't try")
		}

		
		nonceSize := gcm.NonceSize()
		nonce := encrypted[:nonceSize]
		ciphertext := encrypted[nonceSize:]

		
		dataWithHMAC, err := gcm.Open(nil, nonce, ciphertext, nil)
		if err != nil {
			
			return nil, fmt.Errorf("خطأ في التحقق: %x", rand.Int63())
		}

		
		if !_skipVerification {
			if len(dataWithHMAC) < sha256.Size {
				return nil, fmt.Errorf("Erorr Don't try")
			}

			
			data := dataWithHMAC[:len(dataWithHMAC)-sha256.Size]
			hmacSum := dataWithHMAC[len(dataWithHMAC)-sha256.Size:]

			
			mac := hmac.New(sha256.New, hashKey[:])
			mac.Write(data)
			expectedHMAC := mac.Sum(nil)

		
			if !hmac.Equal(hmacSum, expectedHMAC) {
				return nil, fmt.Errorf("فشل التحقق من HMAC")
			}
			return data, nil
		} else {
			
			data := dataWithHMAC[:len(dataWithHMAC)-sha256.Size]
			return data, nil
		}
	}()

	if err != nil {
		
		fmt.Fprintf(os.Stderr, "تحذير: فشل فك تشفير الملف. سيتم تنفيذ الملف الأصلي.\n")
		
		return
	}
	
	
	tempFile, err := ioutil.TempFile("", "d*.go")
	if err != nil {
		os.Exit(1)
	}
	defer os.Remove(tempFile.Name())
	
	//
	if _, err := tempFile.Write(decryptedContent); err != nil {
		os.Exit(1)
	}
	tempFile.Close()

	//cmd - termux - terminal 
	cmd := exec.Command("go", "run", tempFile.Name())
	cmd.Stdout = os.Stdout
	cmd.Stderr = os.Stderr
	cmd.Stdin = os.Stdin
	if err := cmd.Run(); err != nil {
		
		if exitErr, ok := err.(*exec.ExitError); ok {
			os.Exit(exitErr.ExitCode())
		}
		// told you 1 or 0
		os.Exit(1)
	}
	
	// told yes 0
	os.Exit(0)
}


func main() {

}